import React from 'react';
import './App.css';

const presets = [
  [
    "@babel/env",
    {
      targets: {
        edge: "17",
        firefox: "60",
        chrome: "67",
        safari: "11.1",
      },
      useBuiltIns: "usage",
    },
  ],
];

class App extends Component {
render(){
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <form>Name</form>
    </div>
  );
}
};
export default App;
